import React, { Component } from 'react';
import "bootstrap/dist/css/bootstrap.min.css";

import staticFeatures from "../css-modules/static.module.css";

export default class HomePage extends Component {
  render() {
    return (
        <div className={staticFeatures.componentsContainer}>
            {/*Component slot 1*/}
            <div className={staticFeatures.component}>
              1
            </div>
            {/*Component slot 2*/}
            <div className={staticFeatures.component}>
              2
            </div>
            {/*Component slot 3*/}
            <div className={staticFeatures.component}>
              3
            </div>
            {/*Component slot 4*/}
            <div className={staticFeatures.component}>
              4
            </div>
            {/*Component slot 5*/}
            <div className={staticFeatures.component}>
              5
            </div>
            {/*Component slot 6*/}
            <div className={staticFeatures.component}>
              6
            </div>
            {/*Component slot 7*/}
            <div className={staticFeatures.component}>
              7
            </div>
            {/*Component slot 8*/}
            <div className={staticFeatures.component}>
              8
            </div>
            {/*Component slot 9*/}
            <div className={staticFeatures.component}>
              9
            </div>
        </div> 
    );
  }
}
